import { ExerciseCard } from "../../styles/Routine/Routine.style";

function FirstPage({ firstPage, exercises, openCard}) {
  return(
    <>
      {firstPage(exercises).map((exercise) => (
        <ExerciseCard
          key={exercise.id}
          id={exercise.id}
          type={exercise.type}
          part={exercise.part}
          name={exercise.name}
          duration={exercise.duration}
          calories={exercise.calories} 
          openCard={openCard} />
      ))}
    </>
  )
}

export default FirstPage;
